                HELP_JACKPOT_TITLE: "Jackpot Game",
                HELP_JACKPOT_HTML_TEXT: "Win one of the offered jackpot tiers when three or more jackpot symbols appear on the reels or the jackpot is triggered by а game feature. Spin the jackpot wheel to determine which of the offered jackpot tiers will be won.The size of the segments on the jackpot wheel do not correlate to the odds of winning each jackpot tier represented.The chances of winning a jackpot increase in correlation with the size of the stake played. Тhe jackpot is triggered randomly and can be won by playing any of the linked jackpot games. To win the jackpot, the player is not required to make any decision other than to spin the reels. The stake value cannot be changed during free spins. Internet connectivity issues may cause delays in jackpot messages or updates, but they do not affect actual jackpot wins. It is not possible for two players to win the same jackpot. In the event two jackpot winnings occur close to one another the jackpot will be assigned in their respective order. Due to connectivity issues the jackpot value displayed may differ from the effective jackpot value. The jackpot could be temporary deactivated, when this occurs all contributions are paused. The jackpot amount available upon reactivation will be the same as before the deactivation.",
