                PAYOUT_EXAMPLE_TITLE: "General types of games",
                PAYOUT_EXAMPLE_DESCRIPTION: "Check the pays menu in the game paytable if you are not sure of the game type.<br/><br/>",
                PAYOUT_EXAMPLE_SYMBOL_DESCRIPTION: "The values related to each symbol, shown either on the slot scene or on the dedicated Symbol Wins pages of the Pays menu, represent stake multipliers and not credits.<br/><br/>",
                PAYOUT_EXAMPLE_TEXT: "The prize value from one payline is equal to the total stake divided by the number of paylines, multiplied by the symbol multiplier advertised in the paytable. Where multiple wins occur on multiple win lines, the total win values are summed. If more than one win occurs on the same payline, the largest win is paid. Each individual payline can pay only once per spin.<br/><br/>Example: Total stake is 2. Total paylines are 20. Symbol multiplier for length of 5 is 300. The win for 1 payline with this symbol and length would be calculated as such: 2 / 20 * 300 = 30.<br/><br/>The prize value from one payline in a Multiline game is equal to the stake multiplied by the symbol multiplier advertised in the paytable. Where multiple wins occur on multiple win lines, the total win values are summed. If more than one win occurs on the same payline, the largest win is paid.<br/><br/>Example: Stake is 2. Symbol multiplier for length of 5 is 20. The win for 1 payline with this symbol and length would be calculated as such: 2 * 20 = 40. <br/><br/> The prize value from one way or cluster in a Ways or Winning Clusters game is equal to the stake multiplied by the symbol multiplier advertised in the paytable. Where multiple wins occur on multiple ways or clusters, the total win values are summed.<br/><br/>Example: Total stake = 2. Symbol win multiplier = 2. Win = 2x2 = 4.<br/><br/>",
